      "code": "34.20.10",
      "description": "RMN TORÁCICA",
      "normativa": "Incluye: Honorarios y Gastos. RMN TORÁCICA CON CONTRASTE Incluye: Honorarios y Gastos. Material de contraste Indicaciones: CA de recto irradiado y/o con tto quirúrgico: para Diag./Dif. de recidiva local vs. engrosamiento inflamatorio postquirúrgico o actínico. CA de útero irradiado sin tratamiento quirúrgico: para Diag./Dif. de recidiva local vs. lesión cicatrizal actínica. Caracterización de lesiones en pacientes con contraindicación de contraste EV (ej. insuficiencia renal). Para el resto de las patologías oncológicas existen diferentes estudios por imágenes con mayor utilidad clínica (ej. toma de biopsia, PET, etc). Requisitos: Resumen de historia clínica orientado a la patología a evaluar. Estudio por Imagen previo (TAC/RMN/ECO) que objetive la lesión a evaluar. Indicaciones: CA de recto irradiado y/o con tto quirúrgico: para Diag./Dif. de recidiva local vs. engrosamiento inflamatorio postquirúrgico o actínico. CA de útero irradiado sin tratamiento quirúrgico: para Diag./Dif. de recidiva local vs. lesión cicatrizal actínica. Caracterización de lesiones en pacientes con contraindicación de contraste EV (ej. insuficiencia renal). Para el resto de las patologías oncológicas existen diferentes estudios por imágenes con mayor utilidad clínica (ej. toma de biopsia, PET, etc). Requisitos: Resumen de historia clínica orientado a la patología a evaluar. Estudio por Imagen previo (TAC/RMN/ECO) que objetive la lesión a evaluar. Indicaciones: El examen clínico es suficiente en la evaluación de la mayoría de las disfunciones del piso pelviano, ya sea incontinencia urinaria de esfuerzo o incontinencia anal. Las guías de práctica clínica condicionan su uso al compartimento medio o posterior, aunque sin establecer superioridad ante otros estudios por imágenes. Podría tener algún beneficio, por lo que se cubrirá evaluando previamente cada caso: Compartimiento anterior: sospecha de hipermotilidad uretral (como causa de incontinencia urinaria). Compartimento medio: valorar gravedad de prolapso vaginal y de cuello de útero con el esfuerzo. Compartimento posterior: valorar gravedad del rectocele (mide profundidad de la protrusión de la pared rectal con el esfuerzo defecatorio). Requisitos: Resumen de historia clínica orientado a la patología. Estudios de laboratorio y de imágenes previos.",
